import React from "react";
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import employees from "../../employees.json";
import "./style.css"


function createTable(props) {
    console.log("SEARCH: ", props);
    return (
        <div>
            <TableContainer className="employee-table">
                <Table aria-label="employee table">
                    <TableHead>
                        <TableRow>
                            <TableCell /> ID
                            <TableCell align="right"/> Name
                            <TableCell align="right"/> Occuaption
                            <TableCell align="right"/> Salary
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {employees.map((employee) => (
                        <TableRow>
                            <TableCell component="th" scope="row"/> {employee.id}
                            <TableCell /> {employee.name}
                            <TableCell /> {employee.occupation}
                            <TableCell /> {employee.salary}
                        </TableRow>
                        ))};
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    )
};

export default createTable;
